import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const Project = () => {
  return (
    <div id="projects">
      <div className="text-center hd">
        <div className="bg-blue border-8">
          <h4 className="text-lg">Projects I have Done</h4>
          <h2>Android App</h2>
          <p>A blood group searching and donour app in your city</p>
        </div>
      </div>
    </div>
  );
};
export default Project;
